import React,{Component} from 'react';
import axios from 'axios';
class Testtable extends Component {
  constructor(props) {
    super(props);
    this.state = { 
      data:'',
      geturl:'http://localhost:9082/api/test',
      headers:''
      // deleteurl='',
     }
  }
componentDidMount(){
  axios.get(this.state.geturl)
  .then(res=>{
    console.log(res.data.message);
    this.setState({data:res.data.message})
    this.setState({headers:Object.keys(this.state.data[0])})
    console.log("The Headers:- " , this.state.headers);
  })
}
  render() { 
    return (  
      <div>
        
        { this.state.data.length > 0 ? 
        <table>
          <thead>
          {
            this.state.headers.map(
(item,pos)=>
            {
              <th>{item}</th>         
            }
            )
          }
          </thead>
          

        </table>
        : null
        }
      </div>

    );
  }
}
 
export default Testtable;
